import React from 'react'
import Workinprogress from './Workinprogress'

const Bridal = () => {
  return (
    <div>
      <Workinprogress />
      <h1 style={{'text-align': 'center', color:'#8800ff'}}>Bridal</h1>
    </div>
  )
}

export default Bridal
